// SPDX-License-Identifier: MIT
pragma solidity ^0.8.9;

import '@openzeppelin/contracts/token/ERC721/ERC721.sol';
import '@openzeppelin/contracts/token/ERC20/IERC20.sol';
import '@openzeppelin/contracts/access/Ownable.sol';
import '@openzeppelin/contracts/security/ReentrancyGuard.sol';
import '@openzeppelin/contracts/utils/cryptography/MerkleProof.sol';
import '@openzeppelin/contracts/utils/Counters.sol';
import '@openzeppelin/contracts/utils/Strings.sol';

contract SHIWA is ERC721, Ownable, ReentrancyGuard {
  using Strings for uint256;
  using Counters for Counters.Counter;

  bytes32 public root;

  address proxyRegistryAddress;
  address tokenAddress;

  uint256 public maxSupply = 1000;

  string public baseURI;
  string public notRevealedUri =
    'ipfs://QmV3L6c8wij1w1bM2nbAuGpDghD7kDeDi4sS7zEoS4fBWo/hidden.json';
  string public baseExtension = '.json';

  bool public paused = false;
  bool public revealed = false;
  bool public presaleM = false;
  bool public publicM = true;

  uint256 presaleAmountLimit = 3;
  mapping(address => uint256) public _presaleClaimed;

  uint256 private price = 880000000000000000000;

  Counters.Counter private _tokenIds;

  uint256[] private _teamShares = [67, 33];
  address[] private _team = [
    0x2FaE7fB0C9479C083E8454A2fc61Dd198803Dc26,
    0x22Ce3C2A7bBB1b8FE6236034f06A0ad8bc73D63C
  ];

  constructor(
    string memory uri,
    bytes32 merkleroot,
    address _proxyRegistryAddress,
    address _tokenAddress
  )
    ERC721('SHIWA', 'SHIWA')
    ReentrancyGuard() // A modifier that can prevent reentrancy during certain functions
  {
    root = merkleroot;
    proxyRegistryAddress = _proxyRegistryAddress;
    tokenAddress = _tokenAddress;

    setBaseURI(uri);
  }

  function setBaseURI(string memory _tokenBaseURI) public onlyOwner {
    baseURI = _tokenBaseURI;
  }

  function _baseURI() internal view override returns (string memory) {
    return baseURI;
  }

  function reveal() public onlyOwner {
    revealed = true;
  }

  function setMerkleRoot(bytes32 merkleroot) public onlyOwner {
    root = merkleroot;
  }

  modifier onlyAccounts() {
    require(msg.sender == tx.origin, 'Not allowed origin');
    _;
  }

  modifier isValidMerkleProof(bytes32[] calldata _proof) {
    require(
      MerkleProof.verify(
        _proof,
        root,
        keccak256(abi.encodePacked(msg.sender))
      ) == true,
      'Not allowed origin'
    );
    _;
  }

  function togglePause() public onlyOwner {
    paused = !paused;
  }

  function togglePresale() public onlyOwner {
    presaleM = !presaleM;
  }

  function togglePublicSale() public onlyOwner {
    publicM = !publicM;
  }

  function presaleMint(
    address account,
    uint256 _amount,
    bytes32[] calldata _proof
  ) external isValidMerkleProof(_proof) onlyAccounts {
    require(msg.sender == account, 'SHIWA: Not allowed');
    require(presaleM, 'SHIWA: Presale is OFF');
    require(!paused, 'SHIWA: Contract is paused');
    require(
      _amount <= presaleAmountLimit,
      "SHIWA: You can't mint so much tokens"
    );
    require(
      _presaleClaimed[msg.sender] + _amount <= presaleAmountLimit,
      "SHIWA: You can't mint so much tokens"
    );

    uint256 current = _tokenIds.current();

    require(current + _amount <= maxSupply, 'SHIWA: max supply exceeded');
    //require(
    //  price * _amount <= msg.value,
    //  'SHIWA: Not enough ethers sent'
    //);

    _presaleClaimed[msg.sender] += _amount;

    IERC20(tokenAddress).transferFrom(
      msg.sender,
      address(this),
      price * _amount
    );

    IERC20(tokenAddress).transfer(
      _team[0],
      (price * _amount * _teamShares[0]) / 100
    );
    IERC20(tokenAddress).transfer(
      _team[1],
      (price * _amount * _teamShares[1]) / 100
    );
    IERC20(tokenAddress).transfer(
      _team[2],
      (price * _amount * _teamShares[2]) / 100
    );

    for (uint256 i = 0; i < _amount; i++) {
      mintInternal();
    }
  }

  function publicSaleMint(uint256 _amount) external onlyAccounts {
    require(publicM, 'SHIWA: PublicSale is OFF');
    require(!paused, 'SHIWA: Contract is paused');
    require(_amount > 0, 'SHIWA: zero amount');

    uint256 current = _tokenIds.current();

    require(current + _amount <= maxSupply, 'SHIWA: Max supply exceeded');
    //require(
    //  price * _amount <= msg.value,
    //  'SHIWA: Not enough ethers sent'
    //);
    IERC20(tokenAddress).transferFrom(
      msg.sender,
      address(this),
      price * _amount
    );

    IERC20(tokenAddress).transfer(
      _team[0],
      (price * _amount * _teamShares[0]) / 100
    );
    IERC20(tokenAddress).transfer(
      _team[1],
      (price * _amount * _teamShares[1]) / 100
    );
    IERC20(tokenAddress).transfer(
      _team[2],
      (price * _amount * _teamShares[2]) / 100
    );

    for (uint256 i = 0; i < _amount; i++) {
      mintInternal();
    }
  }

  function mintInternal() internal nonReentrant {
    _tokenIds.increment();

    uint256 tokenId = _tokenIds.current();
    _safeMint(msg.sender, tokenId);
  }

  function tokenURI(uint256 tokenId)
    public
    view
    virtual
    override
    returns (string memory)
  {
    require(
      _exists(tokenId),
      'ERC721Metadata: URI query for nonexistent token'
    );
    if (revealed == false) {
      return notRevealedUri;
    }

    string memory currentBaseURI = _baseURI();

    return
      bytes(currentBaseURI).length > 0
        ? string(
          abi.encodePacked(currentBaseURI, tokenId.toString(), baseExtension)
        )
        : '';
  }

  function setMintPrice(uint256 _price) public onlyOwner {
    price = _price;
  }

  function setBaseExtension(string memory _newBaseExtension) public onlyOwner {
    baseExtension = _newBaseExtension;
  }

  function setNotRevealedURI(string memory _notRevealedURI) public onlyOwner {
    notRevealedUri = _notRevealedURI;
  }

  function totalSupply() public view returns (uint256) {
    return _tokenIds.current();
  }

  /**
   * Override isApprovedForAll to whitelist user's OpenSea proxy accounts to enable gas-less listings.
   */
  function isApprovedForAll(address owner, address operator)
    public
    view
    override
    returns (bool)
  {
    // Whitelist OpenSea proxy contract for easy trading.
    ProxyRegistry proxyRegistry = ProxyRegistry(proxyRegistryAddress);
    if (address(proxyRegistry.proxies(owner)) == operator) {
      return true;
    }

    return super.isApprovedForAll(owner, operator);
  }
}

/**
  @title An OpenSea delegate proxy contract which we include for whitelisting.
  @author OpenSea
*/
contract OwnableDelegateProxy {

}

/**
  @title An OpenSea proxy registry contract which we include for whitelisting.
  @author OpenSea
*/
contract ProxyRegistry {
  mapping(address => OwnableDelegateProxy) public proxies;
}

